Henry stars as Gareth Blackstock, a talented, arrogant, tyrannical and obsessed chef who has endlessly inventive insults for his staff, unknowing customers, and almost anyone else he encounters. Chef Blackstock's traditional French cuisine with an eclectic flair is served at &quot;Le Chateau Anglais,&quot; a gourmet restaurant in the English countryside that is one of the few in the United Kingdom to receive a two-star rating from Michelin. The chef's quest for perfection and his lack of awareness about the costs of that perfection mean that the restaurant is on the brink of financial collapse when he and his wife Janice (played by Caroline Lee-Johnson) buy it early in the first series. The establishment mostly remains on that brink, despite Janice's best efforts as manager, eventually coming under the control of the boorish Cyril Bryson (Dave Hill) in the final series.

Although focused on the restaurant's kitchen, the countryside (with its black market suppliers) and the Blackstocks' home life are also backdrops for the show; the chef's long hours mean that Janice is routinely neglected in the bedroom, and their plans for a family remain delayed.
